@Injectable({
  providedIn: 'root'
})
export class TableService {
  newData: any;
  tableData: any = [];
  dataUpdate: any = [];
  sendData: any;

  constructor() { }

  data(value: any) {
    this.newData = value
    this.dataUpdate.push(this.newData)
    localStorage.setItem('data', JSON.stringify(this.dataUpdate))
    console.log(this.newData, '001110')
  }
  updateData() {
    this.tableData.push(this.newData)

    console.log(this.tableData, '000')
    return this.tableData
  }
  setData(item: any,i:any) {
    console.log(item, '00099')
    this.sendData = item[i]
  }
  returnData() {
    return this.sendData
  }
}
